    true,nt"url": null,nt"notes": "The NBI System is the collection of bridge
    inspection information and costs associated with bridge replacements of structurally
    deficient bridges on and off the NHS. This data is collected under the auspices
    of the National Bridge Inspection Standards (NBIS) as prescribed by law. The NBI
    System collects the information that is used to determine eligibility for NHS projects,
    performance measure reporting, NHS penalty determination, and reporting to Congress.
     It supports oversight of the NBIS through various report tools, and provides data
    reporting that supports agency strategic goals.",nt"license_title": "Other
